import React from 'react';
// import {
//   Nav,
//   NavLink,
//   NavMenu,
// } from './NavbarElements';
import { BrowserRouter as Router,  Route } from "react-router-dom";


const Navbar = () => {
  return (
    <>
      <Nav>


        <Router>
        <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/about">About</Link>
            </li>
            <li>
              <Link to="/users">Users</Link>
            </li>
          </ul>
        </nav>
          {/* Second Nav */}
          {/* <NavBtnLink to='/sign-in'>Sign In</NavBtnLink> */}
        </Router>
      </Nav>
    </>
  );
};

export default Navbar;
